```javascript
"use strict";

function f_gold(bank) {
    let last = 0, ans = 0;
    for (let i = 0; i < bank.length; i++) {
        let b = bank[i];
        let t = b.split('1').length - 1;
        if (t > 0) {
            ans += last * t;
            last = t;
        }
    }
    return ans;
}
